import React from "react";

function VideoItem(props) {
  return (
    <li>
      <img src={props.videoData.img} alt="" />
      <h3>{props.videoData.title}</h3>
      <p>{props.videoData.title}</p>
    </li>
  );
}

export default VideoItem;
